import logo from "./logo-registro-civil-300-jpg.jpg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>

      <div className="background-div">
        <p>hello</p>
      </div>
    </div>
  );
}

export default App;
